import { Height } from '@mui/icons-material';
import KALMA from './images/KALMALogo.png';

const Project = () => {
  return (
    <section className="project">
      <div className="title">
        <h1>Portfolio</h1>
        <h3>Collaborated Project</h3>
      </div>
      <div onscroll={myFunction()} className="box">
        <img src={KALMA} alt="KALMA"/>
        <h1>KALMA - Kalinga at Agarang Lunas Mobile Application</h1>
        <p>This mobile application was created as a final project in our subject CAPSTONE 401.</p>
        <form href="https://play.google.com/store/apps/details?id=com.kalma.capstonev12">
          <input className="btn btn-s" type="submit" value="Submit" target="_blank" />
        </form>
        <p>Scrolled <span id="myDIV" className='mystyle'>0</span> times.</p>
        </div>
    </section>
  )
}
// console.log(window);
// let sections = document.querySelectorAll('.project');

function myFunction() {
  const element = document.getElementById("myDIV");
  element.classList.add("newone");
}
export default Project
